    item: {
      src:"https://cdn-02.independent.ie/regionals/kerryman/news/article34250758.ece/AUTOCROP/w620/2015-12-02_ker_15039481_I1.JPG",
      score: 0, 
    },
    item2: {
      src:"https://www.nydailynews.com/resizer/3vON2MK4UseCi-KcXQxivVXOPxk=/800x0/arc-anglerfish-arc2-prod-tronc.s3.amazonaws.com/public/4FLF6TGOFJSOHINHYGZABAQBFM.jpg",
      score: 0, 
    },
    item3: {
      src:"http://www.followingthenerd.com/site/wp-content/uploads/mark-hamill-luke-skywalker.jpeg",
      score: 0, 
    },
    item4: {
      src:"https://i.imgur.com/bgcAAKF.png",
      score: 0, 
    },
    item5: {
      src:"https://vignette.wikia.nocookie.net/headhuntersholosuite/images/4/46/BB-8.png/revision/latest?cb=20160117212745",
      score: 0, 
    },
    item6: {
      src:"https://cdn.gamerant.com/wp-content/uploads/Star-Wars-Battlefront-Palpatine.jpg.optimal.jpg",
      score: 0, 
    },

    item5: "https://vignette.wikia.nocookie.net/headhuntersholosuite/images/4/46/BB-8.png/revision/latest?cb=20160117212745",
    item6: "https://cdn.gamerant.com/wp-content/uploads/Star-Wars-Battlefront-Palpatine.jpg.optimal.jpg",
    item7: "https://i.pinimg.com/originals/37/f7/92/37f79245814b336bd27518b94e081b61.jpg",
    item8: "https://vignette.wikia.nocookie.net/p__/images/7/74/Star-wars-obi-wan-kenobi-jedi-cloak-3.jpg/revision/latest?cb=20171231024120&path-prefix=protagonist",
    item9: "https://i.pinimg.com/originals/9b/03/d7/9b03d7aeac67b0285bceeed283fa2e7a.png",
