    item11: "https://starwarsblog.starwars.com/wp-content/uploads/2015/05/CC305017L3-1536x864-641515734419.jpg",
    item12: "https://amp.businessinsider.com/images/529e230ceab8eaca7369ae60-750-563.jpg",
  }


  render() {
    console.log(this.state)
    return (
      <div>
        <img className="card-image" src={this.state.item.src} alt="star-wars" value={this.state.item.score}></img>
        <img className="card-image" src={this.state.img2} alt="star-wars"></img>
        <img className="card-image" src={this.state.img3} alt="star-wars"></img>
        <img className="card-image" src={this.state.img4} alt="star-wars"></img>
        <img className="card-image" src={this.state.img5} alt="star-wars"></img>
        <img className="card-image" src={this.state.img6} alt="star-wars"></img>
        <img className="card-image" src={this.state.img7} alt="star-wars"></img>
        <img className="card-image" src={this.state.img8} alt="star-wars"></img>
        <img className="card-image" src={this.state.img9} alt="star-wars"></img>
        <img className="card-image" src={this.state.img10} alt="star-wars"></img>
        <img className="card-image" src={this.state.img11} alt="star-wars"></img>
        <img className="card-image" src={this.state.img12} alt="star-wars"></img>
      </div>
    );
  }

}

export default Clickimg;
